import React, { useState, useEffect } from "react";

const Phot = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("https://ahegazy.github.io/muslimKit/json/azkar_massa.json")
      .then((response) => response.json())
      .then((data) => {
        
        setData(data)});
  }, []);

  return (
    <div>
      {data.content.map((item) => (
        <div className="d-flex border-bottom mx-3 my-2">
          <img className="img-avatar" src={item.url} alt="fgfhg" />
          <div className="px-3">
            <p className="d-inline fs-3">{item.title}</p>
            <p className="fs-6">{item.zekr}</p>
          </div>
        </div>
      ))}
    </div>
  );
};

export default Phot;
